import { useEffect, useState } from "react"
import api from "../../utils/api";
import { useNavigate } from 'react-router-dom';
export default function Dashbord() {
    const navigate = useNavigate();
    const [loading, setLoading] = useState(true);
    useEffect(() => {
        const fetchdata = async () => {
            try {
                setLoading(true);
                const response = await api.get('/user/dashboard');
                if (!response.data.success) {
                    navigate('/');
                }
                else {
                    setLoading(false);
                }
            } catch (error) {
                // console.error("Error fetching data:", error);
                navigate('/');
            }
        }
        fetchdata();

    })
    if (loading) return <div className=" d-flex justify-content-center text-center app-loader" >
        <div className="loader">
        </div>
    </div>;
    return (
        <>
            <div className="container mt-5">
                <div class="row">
                    <div class="col-sm-6">
                        <div class="card">
                            <img src="/images/dining.jpeg" class="card-img-top" alt="..."  className="imagesizeview"/>
                            <div class="card-body">
                                <h5 class="card-title">Dining Table</h5>
                                <p class="card-text">status for luxury</p>
                                <div class="container">
                                    <div class="row">
                                        <div class="col">
                                            Prize 
                                        </div>
                                        <div class="col">
                                           50000 Rs
                                        </div>
                                    </div>
                                    <div class="row">
                                        <div class="col">
                                            Quantity 
                                        </div>
                                        <div class="col">
                                           50000 Rs
                                        </div>
                                    </div>
                                </div>
                                    {/* <a href="/" class="btn btn-primary">Go somewhere</a> */}
                            </div>
                        </div>
                    </div>
                </div>
            </div>
            </>
            )
}
